import React, { useEffect, useState } from 'react';

function UserData() {
  const [userData, setuserData] = useState([]);

  useEffect(() => {
    // fetch recent actions from Go server
    fetch('http://localhost:9000/userData')
      .then(response => response.json())
      .then(data => {console.log(data);setuserData(data)})
      .catch(error => console.error('Error fetching recent actions:', error));
  }, []); 

  return (
    <div>
      <h1>Users Data</h1>
      {userData.map(enter => (
        <div key={enter.userEntry._id}>
          
          <h3>Handle: {enter.userEntry.handle}</h3>
           <p>TimeSecond:{enter.userEntry.timeSeconds}</p>
          <p>ID: {entry.blogEntry.id}</p>
          <p>Original Locale: {entry.blogEntry.originalLocale}</p>
          <p>Creation Time: {entry.blogEntry.creationTimeSeconds}</p> 
          
        </div>
      ))}
    </div>
  );
}

export default UserData;
